import { createApp } from 'vue'
import App from './App.vue'
import Vue from 'vue';
import VueHotspot from 'vue-hotspot';

createApp(App).mount('#app')

Vue.config.productionTip = false;

Vue.use(VueHotspot);

new Vue({
  render: h => h(App),
}).$mount('#app');
